import './Skills.scss';

const Skills = () => {
  return (
    <div className='skills'>
      <div className='image-container' id='imageContainer'>
        <div className='skill-card skill-card-6'>TypeScript</div>
        <div className='skill-card skill-card-5'>React</div>
        <div className='skill-card skill-card-4'>JS</div>
        <div className='skill-card skill-card-3'>SCSS</div>
        <div className='skill-card skill-card-2'>CSS</div>
        <div className='skill-card skill-card-1'>HTML</div>
      </div>
    </div>
  );
};

export default Skills;
